#Loading all the Needed libraries

import pandas as pd #data modeling, data analysis and data manipulation
import numpy as np # makes code more readable
import re # check if a particular string matches a given regular expression
#!pip install mlxtend # This is to run the Assosiation Rule
from mlxtend.preprocessing import TransactionEncoder
from mlxtend.frequent_patterns import apriori, association_rules
from mlxtend.frequent_patterns import fpgrowth

#!pip install openpyxl #To be able to Export to Excel

import warnings # Ignor uncessary warnings to code
warnings.filterwarnings('ignore')

# Connect to Google Drive (specific to Google Colab)
from google.colab import drive
drive.mount('/content/drive')

# Load the data from Excel
# NOTE : This path has to be changed to new Dataset file for code to run, pull path from mounted drive
file_path = '/content/drive/MyDrive/PRODASS_TEST/Transaction_Analysis_Input/Trans_29mrt_04Apr.xlsx' # Dataset for Transaction from the 29th March to the 03 April 2024
slip = pd.read_excel(file_path)

# Display the first few rows and the shape of the dataset - Verification step.
print(slip.head())
print(slip.shape)
print(slip.columns)

"""##2. Cleanup the Data
Removal of any unwanted rows in the data set
"""

# Clean up the data by removing unwanted text values
texts_to_delete = [
    "POS:", "User:", "Drawer: Date From:", "Date To:", "00:00:00:00",
    "Till Slip No:", "Store: Springbok Superspar,", "Electronic Till Slip",
    "File:", "Line No Till Slip No Transaction POS User Cash", "Drawer",
    "Date Journal Description", "Auth. Button", "Login No.", "---------------------------------",
    "SLIP / TILL / CASHIER / DATE / TIME", "TRAINING START", "POINTS EARNED:",
    "DEBTOR SUSPENSE", "--------- TAX INVOICE -------", "CASHIER NAME:", "000 ",
    "AUTHORIZATION", "T R A I N I N G", "internal No.:", "TOTAL", "TENDERED Acc Sales",
    "Account Number:", "Loyalty Number:", "Before This Sale", "This Sale", "Actual Account:",
    "VAT rate excl.", "15.00% ", ".2024", "CURRENT ACCOUNT",
    "CHECK YOUR STATEMENT FOR CORRECT BALANCE", "TRAINING END", "TENDERED", "EFT PURCHASE",
    "CUSTOMER COPY", "Approved or completed successfully 00", "35064", "Cashback:", "UTI: ",
    "$BOLD$", "0.00%", "$WIDE$", "DECLINED", "$NORMAL$", ".24", "Pin Verified", "Visa Card",
    "A0000", "ROUNDING", "Savings", "ARQC", "~*", "Transactional", " TC ",
    "Signature: . . . . . . . . . . . . . . . .", "Auth. ", "Debit Mastercard",
    "Online Pin used", "Customer: ", "SPAR CARR VT1", "VISA CHEQUE", "VISA DEBIT", "Visa",
    "MasterCard", "SPAR CARR VT2", "E800", "Long-X-Report", "Voided Item:", "Cheque ",
    "AAC ", "Gold Debit", "REWARDS", ".99", ".49", "150g -5", "Jenine Moses"]
    # Add other unwanted texts as needed

def contains_unwanted_text(line, texts_to_delete):
    return any(text in line for text in texts_to_delete)

# Filter the DataFrame to remove rows with unwanted text
filtered_slip = slip[~slip['Text'].apply(lambda line: contains_unwanted_text(line, texts_to_delete))]

"""##3. Extracting data from the Dataset
Create new Columns: Transaction, Date, Time, Barcode, Product Description

Create new Dataframe to work from : df_cleaned
"""

# Extract valuable information from the filtered data
def extract_data(line):
    parts = line.split()
    if len(parts) >= 10:
        transaction_number = parts[2]
        date = parts[6]
        time = parts[7]
        for i, part in enumerate(parts[8:], 8):
            if part.isdigit() and len(part) > 5:
                barcode = part
                product_description = ' '.join(parts[i + 1:])
                return transaction_number, date, time, barcode, product_description
    return None, None, None, None, None

# Apply the extraction function and create a cleaned DataFrame
extracted_data = [extract_data(line) for line in filtered_slip['Text'] if line.strip()]
extracted_data = [data for data in extracted_data if data[0] is not None]
df_cleaned = pd.DataFrame(extracted_data, columns=['Transaction Number', 'Date', 'Time', 'Barcode', 'Product Description'])
df_cleaned['Date'] = pd.to_datetime(df_cleaned['Date'])

# Print a sample of the cleaned data -  Verification Step
print(df_cleaned.head())

"""##4. Applying the Product Association Rule
Algorithm : Apriori Algorithm

Apriori algorithm is a data mining technique used to identify frequent patterns or associations from a large dataset. It is based on the principle that if a subset of items is frequent, then its superset must also be frequent. In simple terms, it looks for common items that appear together frequently and uses this information to make predictions.

It is useful in a wide range of applications, including market basket analysis, customer segmentation, and recommendation systems.
"""

# Data Aggregation for Association Rule Mining
transactions = df_cleaned.groupby('Transaction Number')['Product Description'].apply(list).reset_index(drop=True)
te = TransactionEncoder()
te_ary = te.fit(transactions).transform(transactions)
df_transactions = pd.DataFrame(te_ary, columns=te.columns_)

# Applying Apriori Algorithm
frequent_itemsets = apriori(df_transactions, min_support=0.001, use_colnames=True)
rules_all = association_rules(frequent_itemsets, metric='confidence', min_threshold=0.001)

# Sort antecedents alphabetically
rules_all['antecedents'] = rules_all['antecedents'].apply(lambda x: sorted(x))
# Sort consequents alphabetically within each group of antecedents
rules_all['consequents'] = rules_all['consequents'].apply(lambda x: sorted(x))

# Format antecedent support, consequent support, support, confidence, and leverage
rules_all['antecedent support'] = (rules_all['antecedent support'] * 100)
rules_all['consequent support'] = (rules_all['consequent support'] * 100)
rules_all['support'] = (rules_all['support'] * 100).round(1)
rules_all['confidence'] = (rules_all['confidence'] * 100).round(1)
rules_all['leverage'] = rules_all['leverage'].round(1)

# Calculate Zhang's metric
rules_all['zhangs_metric'] = rules_all['confidence'] * rules_all['lift']

# Convert frozensets to strings
# Excel does not read the same value set as Phython
rules_all['antecedents'] = rules_all['antecedents'].apply(lambda x: ', '.join(x))
rules_all['consequents'] = rules_all['consequents'].apply(lambda x: ', '.join(x))

"""##5. Promising Combos"""

#pip install --upgrade mlxtend

# Run the fpgrowth algorithm to find frequent itemsets
frequent_itemsets = fpgrowth(df_transactions, min_support=0.0002, use_colnames=True)

# Filter itemsets to those with the desired length (3 to 5 items)
combo_itemsets = frequent_itemsets[frequent_itemsets['itemsets'].apply(lambda x: 3 <= len(x) <= 5)]

# Extract just the itemsets to a list for easy viewing or exporting
product_combos = combo_itemsets['itemsets'].apply(lambda x: ', '.join(list(x))).tolist()

# Now you can print these combos or export them to a file
for combo in product_combos:
    print(combo)

combos_df = pd.DataFrame({'Product Combos': product_combos})

print(combos_df.shape)

"""##6. Comprehensive analysis on Dataset"""

# Daily analysis
daily_results = []
for date, group in df_cleaned.groupby('Date'):
    transactions_daily = group.groupby('Transaction Number')['Product Description'].apply(list).tolist()
    te_ary_daily = te.transform(transactions_daily)
    df_transactions_daily = pd.DataFrame(te_ary_daily, columns=te.columns_)
    most_bought = group['Product Description'].value_counts().idxmax()
    least_bought = group['Product Description'].value_counts().idxmin()
    products_per_basket = group.groupby('Transaction Number').size()
    std_dev_products = products_per_basket.std()
    daily_results.append({
        'Date': date,
        'Most Bought Product': most_bought,
        'Least Bought Product': least_bought,
        'Std Dev of Products in Basket': round(std_dev_products, 2) if std_dev_products else 0,
        'Total Unique Products Sold': group['Product Description'].nunique(),
        'Total Products Sold': group['Product Description'].count(),
        'Total Transactions': group['Transaction Number'].nunique(),
        'Avg Products per Transaction': round(products_per_basket.mean(), 2),
        'Top 10 Products': ', '.join(group['Product Description'].value_counts().head(10).index),
        'Bottom 10 Products': ', '.join(group['Product Description'].value_counts().tail(10).index)
    })

daily_metrics_df = pd.DataFrame(daily_results)

"""##6. Export To HTML"""

# Convert DataFrames to HTML
html_rules = rules_all.to_html(classes='table table-striped', index=False)
html_daily_metrics = daily_metrics_df.to_html(classes='table table-striped', index=False)
html_combos = combos_df.to_html(classes='table table-striped', index=False)

